import React, { Link, Button, Row, Col } from "react"

class Header extends React.Component {
    render() {
        return (
            <div style={{ backgroundColor:'black' }}>
                <ul style={{ listStyle: 'none', display: 'inline' }}>
                    <li>
                        <a href="/home">Home</a>
                    </li>
                    <li>
                        <a href="/home">Video</a>
                    </li>
                    <li>
                        <a href="/home">Photos</a>
                    </li>
                </ul>

            </div>
        )
    }
}

export default Header;
